import React from "react";

const Sicilylines = () => {
  return (
    <div>
      <img
        src="./frontapp.png"
        alt="Sicilylines"
        style={{ width: "40%", borderRadius: "5%" }}
      ></img>
    </div>
  );
};

export default Sicilylines;
